import React, { useState } from "react";
import logo from "../assets/Logo-removebg.png";
import brandName from "../assets/LogoName-removebg.png";

const Navbar = () => {
    const [open, setOpen] = useState(false);

    return (
        <header className={`flex w-full items-center bg-lightGrey`}>
            <div className="container">
                <div className="relative -mx-4 flex items-center justify-between">
                    <div className="w-50 max-w-full px-4">
                        <a href="/" className="w-full py-5 flex">
                            <img
                                src={logo}
                                alt="logo"
                                className="h-20 w-20"
                            />
                            <img
                                src={brandName}
                                alt="brandName"
                                className="object-cover h-20 w-150"
                            />
                        </a>
                    </div>
                    <div className="flex w-full items-center justify-between px-4">
                        <div>
                            <button
                                onClick={() => setOpen(!open)}
                                id="navbarToggler"
                                className={` ${
                                    open && "navbarTogglerActive"
                                } absolute right-4 top-1/2 block -translate-y-1/2 rounded-lg px-3 py-[6px] ring-primary focus:ring-2 lg:hidden`}
                            >
                                <span className="relative my-[6px] block h-[2px] w-[30px] bg-body-color"></span>
                                <span className="relative my-[6px] block h-[2px] w-[30px] bg-body-color"></span>
                                <span className="relative my-[6px] block h-[2px] w-[30px] bg-body-color"></span>
                            </button>
                            <nav
                                // :className="!navbarOpen && 'hidden' "
                                id="navbarCollapse"
                                className={`absolute right-4 top-full w-full max-w-[250px] rounded-lg px-6 py-5 shadow lg:static lg:block lg:w-full lg:max-w-full lg:shadow-none ${
                                    !open && "hidden"
                                } `}
                            >
                                <ul className="block lg:flex">
                                    <ListItem NavLink="/#">Home</ListItem>
                                    <ListItem NavLink="/#">Payment</ListItem>
                                    <ListItem NavLink="/#">About</ListItem>
                                    <ListItem NavLink="/#">Blog</ListItem>
                                </ul>
                            </nav>
                        </div>
                        <div className="hidden justify-end pr-16 sm:flex lg:pr-0">
                            <a
                                href="/#"
                                className="rounded-md bg-secondary px-7 py-3 text-base font-medium text-black hover:bg-secondary/90"
                            >
                                Sign in
                            </a>

                            <a
                                href="/#"
                                className="rounded-md bg-primary px-7 py-3 text-base font-medium text-white hover:bg-primary/90"
                            >
                                Sign Up
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        </header>
    );
};

export default Navbar;

const ListItem = ({ children, NavLink }) => {
    return (
        <>
            <li>
                <a
                    href={NavLink}
                    className="flex py-2 text-base font-medium text-primary hover:text-primary/60  lg:ml-12 lg:inline-flex"
                >
                    {children}
                </a>
            </li>
        </>
    );
};
